, "id": "c86958f4-4bd2-7450-15ff-4c490820f58f", "identifier": [{"system": "urn:oid:1.2.840.114350.1.13.478.3.7.2.798268", "value": "2061345"}], "status": "final", "code": {"coding": [{"code": "201700", "display": "Pharmacogenomics", "system": "urn:oid:1.2.840.114350.1.13.478.3.7.2.696580"}]}, "effectivePeriod": {"start": "2022-03-31T22:36:00Z", "end": "2022-03-31T22:36:00Z"}, "subject": {"reference": "Patient/8f17ebaf-226e-4565-a8e4-1fd09cc4f25a"}, "performer": [{"reference": "Organization/22c6cdd0-bde1-e220-9ba4-2c2802f795ad"}], "result": [{"reference": "Observation/2e9477e8-412b-905c-270f-16ca12bff791"}, {"reference": "Observation/ed66ccf7-584a-1142-b9a4-8fe01b6f21fb"}], "meta": {"source": "ecr"}}, "request": {"method": "PUT", "url": "DiagnosticReport/c86958f4-4bd2-7450-15ff-4c490820f58f"}}, {"fullUrl": "urn:uuid:2e9477e8-412b-905c-270f-16ca12bff791", "resource": {"resourceType": "Observation", "id": "2e9477e8-412b-905c-270f-16ca12bff791", "meta": {"profile": ["http://hl7.org/fhir/us/core/StructureDefinition/us-core-observationresults"], "source": "ecr"}, "identifier": [{"system": "urn:oid:1.2.840.114350.1.13.478.3.7.7.798268.1000", "value": "2061345"}], "category": [{"coding": [{"system": "http://terminology.hl7.org/CodeSystem/observation-category", "code": "laboratory"}]}], "status": "final", "code": {"coding": [{"code": "NAR", "system": "urn:oid:1.2.840.114350.1.72.1.5220"}]}, "effectiveDateTime": "2022-03-31T22:51:17Z", "valueString": "Pharmacogenomics: Final Report<br/><br/>Request #: MD-22-0000041<br/><br/>Service Date: 3/31/2022 17:36<br/><br/>Reason for Request: Genotyping for Determination of Drug Efficacy, Dosage and Safety<br/><br/>Type of Specimen: DNA<br/><br/>Date Received: 3/31/2022 17:44<br/><br/>Date Reported: 3/31/2022 17:51<br/><br/>Interpretation: <br/>Results from this assay may indicate dosage adjustments or medication alternatives that should be considered for this patient. Additional information regarding the implications of these results is available at www.mydruggenome.org. <br/><br/>For VUMC patients, clinical decision support regarding the management of this patient with respect to specific drugs based upon the patient''s genotype as listed below is available in the patient''s electronic medical record under Genomic Indicators. Clinical decision support may also be provided for some drugs through order entry and medication prescribing tools utilized within the VUMC system.<br/><br/><br/><br/>Comments:<br/><br/>Results:<br/><br/>CYP2C19 - \u00a0Cancelled<br/><br/>CYP2C9 - \u00a0 Cancelled<br/><br/>CYP2D6 - \u00a0 Cancelled \u00a0 <br/><br/>CYP3A5 - \u00a0 Cancelled<br/><br/>CYP4F2 - \u00a0 Cancelled<br/><br/>DPYD - \u00a0 \u00a0 Cancelled<br/><br/>NUDT15 - \u00a0 Cancelled<br/><br/>SLCO1B1 - \u00a0Cancelled \u00a0 \u00a0 \u00a0 <br/><br/>TPMT - \u00a0 \u00a0 Cancelled <br/><br/>VKORC1 - \u00a0 Cancelled \u00a0 \u00a0 <br/> \u00a0<br/>These results should be correlated with other laboratory and clinical findings and additional testing should be considered if clinically indicated.<br/> \u00a0 \u00a0 <br/><br/>Methodology:<br/><br/>DNA was extracted from this specimen and screened for 37 variants in 10 genes that are associated with drug absorption, distribution, metabolism, excretion or response. The reported genotypes were determined using PCR amplification and oligonucleotide primers specific for each interrogated region of the genes listed within this panel. Fluorophore labeled probes were used to identify each variant.<br/><br/>Variants analyzed in this assay include: CYP2C19 *2, *3, *4, *6, *8, *17; CYP2C9 *2, *3, *6, *8; CYP3A5 *3, *6, *7; CYP4F2 *3; DPYD *2A, *13, c.557A>G, c.1236G>A (HapB3), c.2846A>T; \u00a0NUDT15 *2 or *3; SLCO1B1 *5; TPMT *2, *3B, *3C, *4; VKORC1 promoter variant c.-1639G>A; and CYP2D6 copy number and variants *2, *2A, *3, *4, *6, *7, *9, *10, *17, *29 and *41. A *1 allele is considered the reference (normal) sequence and is reported if none of the variants analyzed for a particular gene is detected. This assay is specific for the variants listed above and cannot exclude the presence of other variants within these genes that may affect the pharmacologic function of the protein product encoded by these genes. In most cases, variants for a particular gene exist on separate alleles; however, for individuals in which multiple variants in the same gene are detected, this assay cannot determine if the variants are on the same allele or on different alleles. Further, due to the highly polymorphic<br/> nature of these regions, rare variants may exist that could affect the sensitivity or specificity of this assay and lead to a false-negative or a false-positive result.<br/><br/><br/>Electronically signed out by:<br/>Barba, Elizabeth<br/><br/>on 03/31/2022<br/><br/>This assay has not been cleared or approved by the US Food and Drug Administration. The performance of this assay was tested and validated prior to use for patient testing. This test is used for clinical purposes and should not be regarded as investigational or research. This laboratory is regulated by the Clinical Laboratory Improvement Act of 1988.", "extension": [{"url": "http://hl7.org/fhir/R4/specimen.html", "extension": [{"url": "specimen source", "valueString": "DNA"}, {"url": "specimen collection time", "valueDateTime": "2022-03-31T22:36:00Z"}, {"url": "specimen receive time", "valueDateTime": "2022-03-31T22:44:00Z"}, {"url": "observation entry reference value", "valueString": "#Result.1.2.840.114350.1.13.478.3.7.2.798268.2061345.Narrative"}]}], "subject": {"reference": "Patient/8f17ebaf-226e-4565-a8e4-1fd09cc4f25a"}, "performer": [{"display": "VUMC CERNER LAB", "reference": "Organization/e3ece69c-0968-59c9-47dd-f16db731621a"}]}, "request": {"method": "PUT", "url": "Observation/2e9477e8-412b-905c-270f-16ca12bff791"}}, {"fullUrl": "urn:uuid:ed66ccf7-584a-1142-b9a4-8fe01b6f21fb", "resource": {"resourceType": "Observation", "id": "ed66ccf7-584a-1142-b9a4-8fe01b6f21fb", "meta": {"profile": ["http://hl7.org/fhir/us/core/StructureDefinition/us-core-observationresults"], "source": "ecr"}, "identifier": [{"system": "urn:oid:1.2.840.114350.1.13.478.3.7.2.798268", "value": "2061345"}], "category": [{"coding": [{"system": "http://terminology.hl7.org/CodeSystem/observation-category", "code": "laboratory"}]}], "status": "final", "effectiveDateTime": "2022-03-31T22:51:17Z", "valueCodeableConcept": {"coding": [{"code": "16", "system": "urn:oid:1.2.840.114350.1.72.1.5007"}]}, "extension": [{"url": "http://hl7.org/fhir/R4/specimen.html", "extension": [{"url": "specimen source", "valueString": "DNA"}, {"url": "specimen collection time", "valueDateTime": "2022-03-31T22:36:00Z"}, {"url": "specimen receive time", "valueDateTime": "2022-03-31T22:44:00Z"}]}], "subject": {"reference": "Patient/8f17ebaf-226e-4565-a8e4-1fd09cc4f25a"}}, "request": {"method": "PUT", "url": "Observation/ed66ccf7-584a-1142-b9a4-8fe01b6f21fb"}}, {"fullUrl": "urn:uuid:b0f590a6-4bf5-7add-9716-2bd3ba6defb2", "resource": {"resourceType": "DiagnosticReport", "id": "b0f590a6-4bf5-7add-9716-2bd3ba6defb2", "identifier": [{"system": "urn:oid:1.2.840.114350.1.13.478.3.7.2.798268", "value": "2061347"}], "status": "final", "code": {"coding": [{"code": "118330", "display": "Cytogenomic SNP microarray", "system": "urn:oid:1.2.840.114350.1.13.478.3.7.2.696580"}]}, "effectivePeriod": {"start": "2022-04-04T16:55:00Z", "end": "2022-04-04T16:55:00Z"}, "subject": {"reference": "Patient/8f17ebaf-226e-4565-a8e4-1fd09cc4f25a"}, "performer": [{"reference": "Organization/22c6cdd0-bde1-e220-9ba4-2c2802f795ad"}], "result": [{"reference": "Observation/2a4f8fb5-f957-3c30-1353-a30aa441a12b"}, {"reference": "Observation/2e70be1d-fa6c-0256-cf67-f695f5bba1ac"}, {"reference": "Observation/97b316f7-bb96-051f-adba-72ddc4ae5825"}], "meta": {"source": "ecr"}}, "request": {"method": "PUT", "url": "DiagnosticReport/b0f590a6-4bf5-7add-9716-2bd3ba6defb2"}}, {"fullUrl": "urn:uuid:2a4f8fb5-f957-3c30-1353-a30aa441a12b", "resource": {"resourceType": "Observation", "id": "2a4f8fb5-f957-3c30-1353-a30aa441a12b", "meta": {"profile": ["http://hl7.org/fhir/us/core/StructureDefinition/us-core-observationresults"], "source": "ecr"}, "identifier": [{"system": "urn:oid:1.2.840.114350.1.13.478.3.7.7.798268.1000", "value": "2061347"}], "category": [{"coding": [{"system": "http://terminology.hl7.org/CodeSystem/observation-category", "code": "laboratory"}]}], "status": "final", "code": {"coding": [{"code": "NAR", "system": "urn:oid:1.2.840.114350.1.72.1.5220"}]}, "effectiveDateTime": "2022-04-18T19:57:02Z", "valueString": "MICROARRAY REPORT- Corrected<br/><br/>Request#: CG-22-0000006<br/>Service date: 4/4/2022 11:55<br/><br/>Microarray Result: <br/>Normal female <br/><br/>Microarray Interpretation: <br/>SNP chromosomal microarray analysis (CMA) of a blood sample from this patient demonstrated no copy number changes of known clinical significance. No large regions of homozygosity (ROH) were detected. The ISCN nomenclature describing this result is: arr(X,1-22)x2.<br/>Electronically signed out by:<br/>Benfield, Luis A<br/><br/>on 04/18/2022<br/>___________________________________________________________________<br/><br/>Clinical indication: <br/>Specimen List: Blood<br/>Date in Lab: 4/18/2022 14:46<br/>Date Collected: 4/4/2022 11:55<br/>___________________________________________________________________<br/><br/>Disclaimer:<br/><br/>Copy number gains less than 400 kb in size and copy number losses less than 200 kb in size will not be reported unless they represent a known or suspected clinically relevant imbalance. The reporting of copy number variants less than 100 kb in size is at the discretion of the laboratory and some clinically relevant copy number changes under 50 kb may not be reported due to limitations in probe coverage in certain genomic regions. Copy number changes of any size with no apparent clinical significance (likely benign or benign) have not been discussed in this report but may be available upon request. Regions of homozygosity (ROH) less than 10 Mb in size will not be reported unless the ROH is clinically relevant for potential uniparental disomy. Genome-wide ROH under 2% will not be reported. Copy number variants less than 200 kb associated with a carrier status for autosomal recessive conditions will not be reported unless specifically indicated in the reason for referral.<br/><br/>This microarray was designed and manufactured by Affymetrix for the sole purpose of identifying DNA copy number gains and losses associated with chromosomal imbalances and regions of homozygosity (ROH) associated with uniparental isodisomy (isoUPD).This microarray will detect aneuploidy, deletions and duplications of loci represented on the microarray. \u00a0It will not detect balanced alterations including: reciprocal translocations, inversions and balanced insertions. It will not detect point mutations and imbalances less than 10 kb. \u00a0Failure to detect an alteration at any locus does not exclude the diagnosis of any of the disorders represented on the microarray. This assay is not designed to detect mosaic gains and losses and its performance in detecting mosaicism has not been established. This test was developed and its performance characteristics determined by Affymetrix as required by CLIA \u00c2\u201988 regulations. This test is used for clinical purposes and the accuracy and precision has <br/>been established and verified by this laboratory. This test has not been cleared or approved by the U.S. Food and Drug Administration.<br/><br/>Interpretation of copy number variants is performed using VUMC-laboratory maintained databases as well as the following resources:<br/>Database of Genomic Variants (http://dgv.tcag.ca/dgv/app/home)<br/>Online Mendelian Inheritance in Man (http://www.omim.org/)<br/>UCSC Genome Bioinformatics (http://genome.ucsc.edu/cgi-bin/hgGateway)<br/>ClinGen Clinical Genome Resource (http://www.ncbi.nlm.nih.gov/projects/dbvar/clingen)<br/>DECIPHER Database (https://decipher.sanger.ac.uk/browser)<br/>PubMed-NCBI (http://www.ncbi.nlm.nih.gov/pubmed)<br/>Technical standards for the interpretation and reporting of constitutional copy-number variants: a joint consensus recommendation of the American College of Medical Genetics and Genomics (ACMG) and the Clinical Genome Resource (ClinGen). PMID: 31690835<br/><br/>Method: <br/>Microarray platform: ThermoFisher Scientific CytoScanTM HD Cytogenetics Solution<br/>Version: 1.1 (Based on UCSC hg19 assembly)<br/>Number of loci analyzed: 2,696,550<br/>Mean probe spacing: <700 bp<br/><br/><br/><br/><br/><br/><br/>Testing performed at Vanderbilt Cytogenetics One Hundred Oaks Laboratory, Suite 21100, 719 Thompson Ln,<br/>Nashville, TN 37204 \u00a0phone 615-875-0228, fax 615-875-0234", "extension": [{"url": "http://hl7.org/fhir/R4/specimen.html", "extension": [{"url": "specimen source", "valueString": "Blood"}, {"url": "specimen collection time", "valueDateTime": "2022-04-04T16:55:00Z"}, {"url": "specimen receive time", "valueDateTime": "2022-04-18T19:46:00Z"}, {"url": "observation entry reference value", "valueString": "#Result.1.2.840.114350.1.13.478.3.7.2.798268.2061347.Narrative"}]}], "subject": {"reference": "Patient/8f17ebaf-226e-4565-a8e4-1fd09cc4f25a"}, "performer": [{"display": "VUMC CERNER LAB", "reference": "Organization/e3ece69c-0968-59c9-47dd-f16db731621a"}]}, "request": {"method": "PUT", "url": "Observation/2a4f8fb5-f957-3c30-1353-a30aa441a12b"}}, {"fullUrl": "urn:uuid:2e70be1d-fa6c-0256-cf67-f695f5bba1ac", "resource": {"resourceType": "Observation", "id": "2e70be1d-fa6c-0256-cf67-f695f5bba1ac", "meta": {"profile": ["http://hl7.org/fhir/us/core/StructureDefinition/us-core-observationresults"], "source": "ecr"}, "identifier": [{"system": "urn:oid:1.2.840.114350.1.13.478.3.7.7.798268.71", "value": "2061347"}], "category": [{"coding": [{"system": "http://terminology.hl7.org/CodeSystem/observation-category", "code": "laboratory"}]}], "status": "final"